Page=new Array();Page[0]=new Array("Oracle® Health Sciences InForm","Clinical Data API Guide","Release 6.2","Part number: E89726-01","","title.htm");
Page[1]=new Array("The Clinical Data API is an application program interface (API) that allows remote users; that is, users who do not have access to the physical machine on which the InForm application is installed, to submit clinical data to the InForm application. ","To submit data to the InForm application using the Clinical Data API, you must use an XML format called InForm ODM. InForm ODM is based on the ODM XML schema, and has InForm-specific extensions. ","For a description of the supported elements and attributes for InForm ODM, see ODM Submit elements.","Overview of the Clinical Data API","188381.htm");
Page[2]=new Array("The web service URL must resolve to a study name. Additional study name parameters supplied in the message ensure that the routing is correct.","A web service URL includes the following:","http://&lt;fully_qualified_domain_name&gt;:&lt;port&gt;/&lt;study_name&gt;/ws/odmsubmitservice/ODMSubmitService.svc","Web service URL","184795.htm");
Page[3]=new Array("Check IIS to make sure that the Clinical Data API virtual directory was successfully created:","Open the IIS Service Manager.","Navigate to the computer on which the Clinical Data API is installed.","Select Sites &gt; odmsubmitservice_Site.","In the Actions panel, verify that the correct port number is listed under Browse Web Site.","Ensure that you configured the SSL certificate for the Clinical Data API virtual directory.","Verifying the installation","188108.htm");
Page[4]=new Array("To use the WSDL to generate the proxy client code:","For C#, modify the WSDL in the &lt;installation_directory&gt;\\InForm\\ODMSubmitSamples\\WebServiceClients\\CSClientSample folder by replacing the three instances of THE_WEB_SERVICE_URL with a valid URL.","For more information, see C# example.","For Java, modify the WSDL in the &lt;installation_directory&gt;\\InForm\\ODMSubmitSamples\\WebServiceClients\\JavaClientSample\\META-INF\\wsdl folder by replacing the three instances of THE_WEB_SERVICE_URL with a valid URL.","For more information, see Java example.","Using the sample WSDL","205830.htm");
