Page[7]=new Array("To access the web service interfaces and to use the Clinical Data API to submit data securely into the InForm application, the API needs information about two users:","An InForm Integration user with the ODM Submit right. ","An InForm Site or Sponsor user with the Enter CRF data right.","Creating the Clinical Data API users","215522.htm");
Page[8]=new Array("Sample programs with source for C# and Java are available in the following directory:","C# sample programs&#8212;&lt;installation_directory&gt;\\InForm\\ODMSubmitSamples\\WebServiceClients\\CSClientSample","Java sample programs&#8212;&lt;installation_directory&gt;\\InForm\\ODMSubmitSamples\\WebServiceClients\\JavaClientSample","These programs demonstrate communications with the ODM Submit web service, and can be used as a reference as you create a file to submit using the Clinical Data API.","Sample programs for ODM Submit","185417.htm");
Page[9]=new Array("Settings in the web.config file control various aspects of the use of the Clinical Data API. These settings are determined by the behavior you want to control and whether the Clinical Data API uses WCF or WSE as its web service.","By default, these settings are off (disabled). When developing your client, you might want to enable certain settings for testing purposes. However, before deploying your client to production, be sure to disable the settings to ensure web services are secure.","Settings in the web.config file affect the following access to metadata. The Clinical Data API metadata output can be used as input to client programs that you build. Settings in the web.config file control whether metadata is output by an interface, and whether client programs have access to this metadata.","For more information, see Restrict access to service metadata.","web.config settings that secure the Web services","207008.htm");
Page[10]=new Array("By default, WCF services do not publish the metadata. If you want the configuration to allow access to the metadata through the use of import tools such as svcUtil.exe to generate the client code, you must explicitly set the following in the web.config file:","&lt;serviceBehaviors&gt;","	&lt;behavior name=&quot;PhaseForward.InForm.Wcf.ODMSubmit.ODMSubmitServiceBehavior&quot;&gt;","		&lt;serviceMetadata httpGetEnabled=&quot;true&quot; /&gt;","		&lt;serviceDebug includeExceptionDetailInFaults=&quot;true&quot; /&gt;","	&lt;/behavior&gt;","After successfully developing and deploying the client, set the values to false, which prevents unwanted clients from generating proxy files or looking at potentially sensitive information.","&lt;serviceBehaviors&gt;","	&lt;behavior name=&quot;PhaseForward.InForm.Wcf.ODMSubmit.ODMSubmitServiceBehavior&quot;&gt;","		&lt;serviceMetadata httpGetEnabled=&quot;false&quot; /&gt;","		&lt;serviceDebug includeExceptionDetailInFaults=&quot;false&quot; /&gt;","	&lt;/behavior&gt;","If you do not need to publish metadata, leave the setting turned off.","WCF—Enabling and disabling metadata","207011.htm");
Page[11]=new Array("Each request is enclosed in a SOAP envelope that begins with a SOAP header, followed by a Body statement that contains the web method, and its input parameters and values.","Message format","179462.htm");
Page[12]=new Array("The SOAP header contains information about the service, the message, and the sender credentials. It must include all the fields in the following table.","Note: The requirement for requests to contain the wsu:Timestamp, wsse:Username, and wsse:Password elements are defined in the WSDL by ws-policy. If your web service toolkit does not support ws-policy, you must manually add these elements to the web service request. ","ODM Submit&#8212;SOAP Header","Description of SOAP header fields","Field","Description","Standard","wsa:Action","SOAP action for the operation. Include this field as part of the summary for each SOAP operation.","WS-Addressing","wsa:MessageID","Unique ID for the message.","WS-Addressing","wsa:ReplyTo","Specify the following value:","&lt;wsa:ReplyTo xmlns:wsa=&quot;http://www.w3.org/2005/08/addressing&quot;&gt;","&lt;wsa:Address&gt;http://www.w3.org/2005/08/addressing/anonymous&lt;/wsa:Address&gt;","&lt;/wsa:ReplyTo&gt;","WS-Addressing","wsa:To","Full URL of the service.","WS-Addressing","wsu:Timestamp","Time when the message was created and when it expires.","Oracle recommends a five minute time window.","The software allows for five minutes of clock drift between servers. To modify this value in the web.config file, set the MaxClockSkew value.","SOAP Message Security 1.0","wsse:Username","User name of the user in the InForm study. This user must be assigned the Integration user type.","SOAP Message Security 1.0","wsse:Password","Password of the user in the InForm study. This user must be assigned the Integration user type.","SOAP Message Security 1.0","SOAP header","188162.htm");
Page[13]=new Array("The Clinical Data API has three methods, which support: ","Clinical data submission. ","For more information, see ODM Submit&#8212;Submission messages.","Summary reporting for each ODM Submit document that was processed.","For more information, see ODM Submit&#8212;Document status messages.","Historical data reporting.","For more information, see ODM Submit&#8212;Report messages.","The web service methods are synchronous for the remote client. Remote clients send request messages, and the web service returns a response message for each request that indicates success or identifies errors that occurred.","Web service interface methods","188155.htm");
Page[14]=new Array("The WSODMXMLSubmit method accepts incoming messages to be processed by the Clinical Data API. It has two formats:","Request format&#8212;For submitting data.","For more information, see SOAP body for Request message&#8212;Submissions.","Response format&#8212;For returning the submit status of the operation.","For more information, see Response XML format&#8212;Submissions.","ODM Submit—Submission messages","179466.htm");
Page[15]=new Array("Request message parameters","Parameters in SOAP body","Name","Description","TrialName","Name of the study to which to submit data.","SSOTenant","For Oracle-hosted, single sign-on studies, the customer identifier used to scope the credential in the single sign-on environment to a specific customer.","OrgID","User Organizational ID. ","For Oracle-hosted, single sign-on studies, this field is required. ","For InForm native authentication, this field must be blank.","UserName","User name of the InForm user who is submitting the clinical data. This user must be assigned the Enter CRF data right.","UserPassword","Password of the InForm user who is submitting the clinical data. This user must be assigned the Enter CRF data right.","RulesEnabled","Specifies whether rules should be executed when processing clinical data. ","True&#8212;Execute rules.","False&#8212;Do not execute rules.","StopOnError","Specifies the action to take if a submit operation fails during processing.","True&#8212;Stop processing.","False&#8212;Continue processing the document.","SubmitToLockedOrFrozenForms","Allows data to be submitted to locked or frozen forms.","ODMSubmitDocument","String text for the ODM Submit XML document.","ODMSubmitdocumentID","ODM Submit document unique identifier.","WCFUsername","User name of the InForm user who is submitting the clinical data. This user must be assigned the Integration user type and must be assigned the ODM Submit right.","WCFPassword","Password of the InForm user who is submitting the clinical data. This user must be assigned the Integration user type, and must have the ODM Submit right.","SOAP body for Request message—Submissions","207652.htm");
Page[16]=new Array("Response message parameters","Response XML parameters","Name","Description","WSODMXMLSubmitResult","Top-level element with the PROCESSED attribute, which indicates whether the request was processed.","TRUE&#8212;Request was processed successfully.","The SubmitStatus parameter appears and displays text that indicates that the request was processed.","FALSE&#8212;Request was not processed successfully.","The Error parameter appears and displays text that indicates why the request was not processed.","Error","Appears if the PROCESSED attribute for WSODMXmlSubmitResult is set to FALSE.","Contains information about why the web message could not be processed. ","SubmitResults","Appears if the PROCESSED attribute for WSODMXmlSubmitResult is set to TRUE. ","Contains the FileOID, ReceivedDateTime, and ProcessStartDateTime.","SubmitStatus","Appears if the PROCESSED attribute for WSODMXmlSubmitResult is set to TRUE. ","Contains the FileOID, ReceivedDateTime, and ProcessStartDateTime.","SubmitReport","Appears if the PROCESSED attribute for WSODMXmlSubmitResult is set to TRUE. ","Contains the FileOID, ReceivedDateTime, and ProcessStartDateTime.","MessageID","HRESULT error code, which can occur at the web service or the Clinical Data API interface.","Note: Appears only when the STATUS attribute for SubmitStatus is set to FAILED.","Message","English text of the MessageID.","Note: Appears only when the STATUS attribute for SubmitStatus is set to FAILED.","ActivityGUID","Corresponds to the InForm ActivityGUID when an error appears in the event log.","Note: Appears only when the STATUS attribute for SubmitStatus is set to FAILED.","Response XML format—Submissions","188165.htm");
Page[17]=new Array("The WSODMXMLSubmitStatus method accepts an ODMSubmitDocumentID (FileOID in ODM terminology) and returns a summary status for the FileOID. ","ODM Submit—Document status messages","188191.htm");
Page[18]=new Array("Request message parameters","Parameters for SOAP body","Name","Description","TrialName","Name of the study to which to submit data.","SSOTenant","For Oracle-hosted, single sign-on studies, the customer identifier used to scope the credential in the single sign-on environment to a specific customer.","OrgID","User Organizational ID. ","For Oracle-hosted, single sign-on studies, this field is required. ","For InForm native authentication, this field must be blank.","UserName","User name of the InForm user who is submitting the clinical data. This user must be assigned the Enter CRF data right.","UserPassword","Password of the InForm user who is submitting the clinical data. This user must be assigned the Enter CRF data right.","ODMSubmitDocumentID","ODM Submit document unique identifier.","WCFUsername","User name of the InForm user who is submitting the clinical data. This user must be assigned the Integration user type and must be assigned the ODM Submit right.","WCFPassword","Password of the InForm user who is submitting the clinical data. This user must be assigned the Integration user type, and must have the ODM Submit right.","SOAP body for Request messages—Document status","207650.htm");
Page[19]=new Array("Response message parameters","Response message parameters","Name","Description","WSODMXMLSubmitResult","Top-level element with the PROCESSED attribute, which indicates whether the request was processed.","TRUE&#8212;Request was processed successfully.","The SubmitStatus parameter appears and displays text that indicates that the request was processed.","FALSE&#8212;Request was not processed successfully.","The Error parameter appears and displays text that indicates why the request was not processed.","Error","Appears if the PROCESSED attribute for WSODMXmlSubmitResult is set to FALSE.","Contains information about why the web message could not be processed. ","SubmitStatus","Appears if the PROCESSED attribute for WSODMXmlSubmitResult is set to TRUE. ","Contains the FileOID, ReceivedDateTime, and ProcessStartDateTime.","Response XML format—Document status","188164.htm");
Page[20]=new Array("The WSODMXMLSubmitSummary method accepts an ODMSubmitDocumentID (FileOID in ODM terminology), and returns a summary status, and if available, a complete list of individual submit statuses. ","This method is primarily used for remote clients to diagnose submit operations.","Note: The individual submit commands may not be available if you executed the XmlSubmitPurgeRecords stored procedure to remove the detailed submit records from the logging facility. For more information, see Removing Clinical Data API records.","ODM Submit—Report messages","188194.htm");
Page[21]=new Array("Request message parameters","Parameters for SOAP body","Name","Description","TrialName","Name of the study to which to submit data.","SSOTenant","For Oracle-hosted, single sign-on studies, the customer identifier used to scope the credential in the single sign-on environment to a specific customer.","OrgID","User Organizational ID. ","For Oracle-hosted, single sign-on studies, this field is required. ","For InForm native authentication, this field must be blank.","UserName","User name of the InForm user who is submitting the clinical data. This user must be assigned the Enter CRF data right.","UserPassword","Password of the InForm user who is submitting the clinical data. This user must be assigned the Enter CRF data right.","ODMSubmitDocumentID","ODM Submit document unique identifier.","WCFUsername","User name of the InForm user who is submitting the clinical data. This user must be assigned the Integration user type and must be assigned the ODM Submit right.","WCFPassword","Password of the InForm user who is submitting the clinical data. This user must be assigned the Integration user type, and must have the ODM Submit right.","SOAP body for Request messages—Reports","207651.htm");
Page[22]=new Array("Response message parameters","Response message parameters","Name","Description","WSODMXMLSubmitResult","Top-level element with the PROCESSED attribute, which indicates whether the request was processed.","TRUE&#8212;Request was processed successfully.","The SubmitStatus parameter appears and displays text that indicates that the request was processed.","FALSE&#8212;Request was not processed successfully.","The Error parameter appears and displays text that indicates why the request was not processed.","Error","Appears if the PROCESSED attribute for WSODMXmlSubmitResult is set to FALSE.","Contains information about why the web message could not be processed. ","SubmitStatus","Appears if the PROCESSED attribute for WSODMXmlSubmitResult is set to TRUE. ","Contains the FileOID, ReceivedDateTime, and ProcessStartDateTime.","Response XML format—Reports","188166.htm");
Page[23]=new Array("You can use the XmlSubmitPurgeRecords stored procedure, which exists in the study schema, to remove Clinical Data API status records that were submitted prior to a specified date.","To execute XmlSubmitPurgeRecords, use the following syntax:","XmlSubmitPurgeRecords (LastProcessingDate IN DATE)","where:","IN DATE&#8212;Parameter you need to pass the command. Specify a date in the IN DATE parameter, and the XmlSubmitPurgeRecords procedure removes the status records that were submitted before that date. ","The date must use the format yyyy-mm-dd hh:mm:ss. For example, to remove status records prior to February 28, 2014 at 12:30 pm, enter 2014-02-28 12:30:00.","Note: If you run the XmlSubmitPurgeRecords stored procedure, you cannot access detailed information regarding individual status records prior to the date you entered in the IN DATE parameter.&nbsp;You can access only a summary of submits.","Removing Clinical Data API status records","190991.htm");
Page[24]=new Array("The ODM Submit utility supports the use of CDISC standard ODM 1.3 elements and ODM elements with InForm-specific extensions. The prefix pf: identifies InForm-specific extensions.","Notes:","You must escape all attributes.","You must escape element contents or enclose them in a CDATA section.","The first line of the file must be an XML tag that specifies the file encoding. Only UTF-8 encoding is supported, so the first line of the file must be:","&lt;?xml version=&quot;1.0&quot; encoding=&quot;UTF-8&quot;?&gt;","If an unsupported attribute or element is present, an error message is generated and the ODM is not submitted.","About ODM Submit schema elements","188195.htm");
Page[25]=new Array("When you submit data for a control, some of the control data might not be available. For a control with missing data, you can do one of the following:","Exclude the ItemData element for a control for which data was not collected.","Set the IsNull attribute for the control to Yes if data was collected but then cleared, or to clear data for the control.","Note: If you specify the IsNull attribute, you cannot specify the Value attribute for the control.","Missing and empty data values","188240.htm");
Page[26]=new Array("For a control that contains unit information, you can specify the unit value using the MeasurementUnitRef sub-element of the ItemData element. However, you cannot specify a normalized value for the unit.","You can also exclude a unit value for a control that contains unit information. However, if you do not specify a unit the control is marked as incomplete in InForm.","Units and normalized values","220082.htm");
Page[27]=new Array("Use to submit comments and incomplete reasons. The Annotation element can appear as a sub-element of:","ItemData&#8212;For an item-level comment.","For an item-level comment, the ItemData element in which you contain the annotation must point to an item, not a control in an item. For more information, see ItemData.","FormData&#8212;For a form-level comment.","Association","For more information, see Annotation (Sub-element of Association).","Example","&lt;Annotation SeqNum=&quot;1&quot; pf:DBUID=&quot;30087&quot;","pf:GUID=&quot;{885FAAB2-3997-482E-9179-97560DAA33B2}&quot;&gt;","&lt;Comment&gt;item comment when item has many sub-controls&lt;/Comment&gt;","&lt;/Annotation&gt;","Supported sub-elements","Comment&#8212;Optional.","Zero or one instance.","pf:ReasonIncomplete&#8212;Optional.","Zero or one instance.","Supported attributes","SeqNum&#8212;Required. Must be 1. ","Unsupported elements","Flag","pf:AnnotationAuditData","pf:AnnotationAuditRecord","Unsupported attributes","TransactionType","pf:DBUID","pf:GUID","Annotation (Comment)","188196.htm");
Page[28]=new Array("Sub-element of Association.","Example","&lt;Annotation SeqNum=&quot;33663&quot; pf:DBUID=&quot;33663&quot; pf:GUID=&quot;{E34262AA-A279-4BA4-B8BA-DDABE6CC52BB}&quot;&gt;","&lt;Comment&gt;PF Association&lt;/Comment&gt;","&lt;Flag&gt;","&lt;FlagValue CodeListOID=&quot;AssociationAction&quot;&gt;Add&lt;/FlagValue&gt;","&lt;FlagType CodeListOID=&quot;FlagType&quot;&gt;Association&lt;/FlagType&gt;","&lt;/Flag&gt;","&lt;/Annotation&gt;","Supported sub-elements","Flag&#8212;Required.","The Flag sub-element must have the sub-element FlagValue with CodeListOID=AssociationAction. AssociationAction can have a value of Add or Remove.","Annotation (Sub-element of Association)","188223.htm");
Page[29]=new Array("Used to add or remove associations between repeating forms. The Association element is a sub-element of the top-level ODMSubmit element.","Example","&lt;Association StudyOID=&quot;Depression Study&quot;","MetaDataVersionOID=&quot;StudyVersion_ODMTEST03&quot;&gt;","&lt;KeySet StudyOID=&quot;Depression Study&quot;","SubjectKey=&quot;29530&quot;","StudyEventOID=&quot;Visit1&quot; StudyEventRepeatKey=&quot;342216927026073&quot;","FormOID=&quot;LAE1&quot; FormRepeatKey=&quot;343316719654073&quot; /&gt;","&lt;KeySet StudyOID=&quot;Depression Study&quot;","SubjectKey=&quot;29530&quot;","StudyEventOID=&quot;Visit1&quot; StudyEventRepeatKey=&quot;342216927026073&quot;","FormOID=&quot;L_ConMeds&quot; FormRepeatKey=&quot;343316927026073&quot; /&gt;","&lt;Annotation SeqNum=&quot;33663&quot; pf:DBUID=&quot;33663&quot; pf:GUID=&quot;{E34262AA-A279-4BA4-B8BA-DDABE6CC52BB}&quot;&gt;","&lt;Comment&gt;PF Association&lt;/Comment&gt;","&lt;Flag&gt;","&lt;FlagValue CodeListOID=&quot;AssociationAction&quot;&gt;Add&lt;/FlagValue&gt;","&lt;FlagType CodeListOID=&quot;FlagType&quot;&gt;Association&lt;/FlagType&gt;","&lt;/Flag&gt;","&lt;/Annotation&gt;","&lt;/Association&gt;","Supported sub-elements","KeySet&#8212;Required.","Exactly two occurrences.","Annotation&#8212;Required.","Exactly one occurrence.","Supported attributes","StudyOID&#8212;Required.","Study name. Must be current and must match the value specified in the STUDYNAME attribute of the STUDYVERSION MedML element.","MetaDataVersionOID&#8212;Required.","Study version that is assigned to the site. This does not have to be the current study version.","Unsupported elements and attributes","None.","Association","188246.htm");
Page[30]=new Array("Allows you to perform an enrollment override for a subject.","Example","&lt;pf:Candidate EnrollmentOverride=&quot;Date: 11/9/2011 At: 02:03 Monitor: Louise Hill Title: CRA Reason: Subject nearly met criteria&quot; /&gt;","Supported sub-elements","None","Supported attributes","EnrollmentOverride&#8212;Required.","Specify the reason for the enrollment override. ","Unsupported elements","AuditRecord","Unsupported attributes","pf:DateOfBirth","pf:EnrollmentFailure","pf:EnrollmentNumber","pf:PatientNumber","pf:PatientRevision","pf:ScreeningDate","pf:ScreeningFailure","pf:ScreeningNumber","pf:SubjectInitials","pf:Candidate","188247.htm");
Page[31]=new Array("Use to submit data for one or more subjects, each in its own SubjectData sub-element.","Example","&lt;ClinicalData StudyOID=&quot;Depression Study&quot; MetaDataVersionOID=&quot;Study Version 1&quot;","pf:TransactionGuid=&quot;{69B04136-0872-464A-8870-A0BDA864943C}&quot;&gt;","&lt;SubjectData … details omitted","&lt;/ClinicalData&gt;","Supported sub-elements","SubjectData&#8212;Optional.","Zero or more instances. Each instance corresponds to a subject.","Supported attributes","StudyOID&#8212;Required.","Study name. Must be current and must match the value specified in the STUDYNAME attribute of the STUDYVERSION MedML element.","MetaDataVersionOID&#8212;Required.","Study version that is assigned to the site. This does not have to be the current study version.","ClinicalData","188225.htm");
