Page[33]=new Array("Sub-element of the StudyEventData element. Use the FormData element to enter or edit data for one form instance for one subject.","Supported sub-elements","Annotation&#8212;Optional.","Zero or one instance.","ItemGroupData&#8212;Optional.","Zero or more instances.","pf:FormStatus&#8212;Optional.","Zero or one instance.","Supported attributes","FormOID&#8212;Required.","Form RefName.","FormRepeatKey&#8212;Required for repeating forms.","For non-repeating forms&#8212;Do not use.","For repeating forms&#8212;Required. ","A non-null string that identifies the repeating form instance uniquely within the subject visit instance.","pf:FormRepeatKeyOrdinal&#8212;Optional.","For non-repeating forms&#8212;Do not use.","For repeating forms&#8212;Optional.","The 1-based ordinal of the repeating form instance. When computing an ordinal, the calculation counts each instance of the repeating form within a visit instance for a subject, including repeating forms that did not use the pf: FormRepeatKeyOrdinal attribute, and deleted repeating form instances.","Unsupported elements","ArchiveLayoutRef","AuditRecord","Signature","pf:FormAuditData","pf:PFFormSignatures","Unsupported attributes","TransactionType","FormData","188236.htm");
Page[34]=new Array("An InForm-specific sub-element of FormData, used to specify the form status for a single form instance. ","Supported sub-elements","None.","Supported attributes","Frozen&#8212;Optional.","Yes&#8212;Freeze a form.","No&#8212;Unfreeze a form.","Locked&#8212;Optional.","Yes&#8212;Lock a form.","No&#8212;Unlock a form.","Deleted&#8212;Optional.","Yes&#8212;Delete a repeating form.","No&#8212;Undelete a repeating form.","SVReady&#8212;Optional.","Signed&#8212;Optional.","Yes&#8212;Mark a form as Signed.","No&#8212;Not supported. ","SVComplete&#8212;Optional.","Yes&#8212;Source verify a form and all its items and itemsets.","No&#8212;Mark a form and all its items and itemsets as Not Verified. ","Unsupported elements","AuditRecord","Unsupported attributes","pf:Activated","pf:ReviewStateRevision","pf:SVPartial","pf:SVSelected","pf:FormStatus","213616.htm");
Page[35]=new Array("Sub-element of the ItemGroupData element, used to specify an item comment or the value of an item or control.","Example","&lt;ItemData ItemOID=&quot;frmDOV.DOV.DOV.DOV&quot;","Value=&quot;2011-10-19T09:17&quot;&gt;","&lt;/ItemData&gt;","Supported sub-elements","MeasurementUnitRef&#8212;Optional.","Zero or one instance.","Annotation&#8212;Optional.","Zero or one instance.","Supported attributes","ItemOID&#8212;Required.","The RefName path from the form to the item or control.","For a non-repeating item&#8212;FORM.SECTION.ITEM.[CONTROL]","For an item in an itemset&#8212;FORM.SECTION.ITEMSET.ITEM.[CONTROL]","Note: The ItemData element is contained in the ItemGroupData element, which also has a RefName path; the two paths must not conflict.","Value&#8212;Optional.","The value for the item, control, or comment.","pf:FormattedDateValue&#8212;Optional.","Indicates whether a date component without a specified value is empty or is set to Unknown.","If you use both the Value attribute and the pf:FormattedDateValue attribute:","The parts of the date that you supply in the Value attribute must exactly match the value in the pf:FormattedDateValue attribute.","The parts of the date that are unspecified in the Value attribute must be unspecified in pf:FormattedDateValue. However, in the pf:FormattedDateValue attribute, unspecified date parts are identified as either No value supplied or Date part unknown. ","Unsupported elements","AuditRecord","Signature","Unsupported attributes","IsNull","pf:ItemAuditData","pf:NormalizedValue","pf:ReasonIncomplete","pf:TransactionType","ItemData","188237.htm");
Page[36]=new Array("Indicates whether a date component without a specified value is empty or is set to Unknown.","If you use both the Value attribute and the pf:FormattedDateValue attribute:","The parts of the date that you supply in the Value attribute must exactly match the value in the pf:FormattedDateValue attribute.","The parts of the date that are unspecified in the Value attribute must be unspecified in pf:FormattedDateValue. However, in the pf:FormattedDateValue attribute, unspecified date parts are identified as either No value supplied or Date part unknown. ","The following example shows a date/time control where the month and hour are Unknown, and the day and minute are not entered:","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.dtcDateD &quot;","Value=&quot;2015----T-:-&quot; ","pf:FormattedDateValue=&quot;2015-UNK-NULTUNK:NUL:NUL&quot;/&gt;","The pf:FormattedDateValue element allows you to specify the value UNK for parts that are Unknown and NUL for parts that were not specified.","pf:FormattedDateValue","188401.htm");
Page[37]=new Array("Sub-element of the ItemGroupData element, used to source verify items.","Example","&lt;pf:InFormItemData InFormItemOID=&quot;frmDOV.DOV.DOV.DOV&quot; Name=&quot;DOV_Item&quot;&gt; &lt;pf:ItemStatus SourceVerified=&quot;Yes&quot;/&gt;","&lt;/pf:InFormItemData&gt;","Supported sub-elements","pf:ItemStatus&#8212;Optional.","Zero or one instance.","Supported attributes","InFormItemOID&#8212;Required.","The RefName path from the form to the item or control FORM.SECTION.ITEM.[CONTROL].","Note: The InFormItemData element is contained in the ItemGroupData element, which also has a RefName path; the two paths must not conflict.","Name&#8212;Required.","The name of the item.","Unsupported elements","None","Unsupported attributes","None","InFormItemData","213617.htm");
Page[38]=new Array("Sub-element of the FormData element. Use the ItemGroupData element to enter data for one section of a form instance.","Example","&lt;ItemGroupData ItemGroupOID=&quot;frmDOV.DOV&quot;&gt;","&lt;ItemData ItemOID=&quot;frmDOV.DOV.DOV.DOV&quot;","Value=&quot;2011-10-19T09:17&quot;&gt;","&lt;/ItemData&gt;","&lt;/ItemGroupData&gt;","Supported sub-elements","ItemData&#8212;Optional.","Zero or many instances, in any order.","pf:ItemStatus&#8212;Optional.","Zero or one instance.","pf:InFormItemData&#8212;Optional. ","Zero or many instances, in any order.","Supported attributes","ItemGroupOID&#8212;Required.","RefName path of the item into which to enter data:","For a non-repeating item&#8212;FORM.SECTION","For an itemset&#8212;FORM.SECTION.ITEMSET","The ItemGroupData element is a sub-element of the FormData element, which specifies the form RefName. The form RefName that you specify in the FormData element must match the form RefName that you specify in the ItemGroupOID attribute.","ItemGroupRepeatKey&#8212;Optional.","For a non-repeating item&#8212;Not required.","For an item in an itemset&#8212;Required. ","A non-null string that uniquely identifies an itemset row within a form instance.","pf:ItemGroupRepeatKeyOrdinal&#8212;Optional.","The 1-based ordinal value of the itemset row in the form instance. Each row in the itemset is counted when computing an ordinal, including prior rows that did or did not use the pf:ItemGroupRepeatKeyOrdinal attribute, and deleted Add Entry itemset rows.","Unsupported elements","AuditRecord","Signature","TransactionType","pf:Query","ItemGroupData","213618.htm");
Page[39]=new Array("Sub-element of the ItemGroupData and InFormItemGroupData elements.","Example","&lt;pf:ItemStatus Deleted=&quot;No&quot;&gt;","&lt;/pf:ItemStatus&gt;","Supported sub-elements","None","Supported attributes","Deleted&#8212;Required. Only supported if ItemGroupData is the immediate parent element.","Yes&#8212;Delete an Add Entry itemset row.","No&#8212;Undelete an Add Entry itemset row.","SourceVerified&#8212;Optional.","When used under ItemGroupData:","Yes&#8212;Source verify an Add Entry itemset row.","No&#8212;Mark an Add Entry itemset row as Not Verified.  ","When used under InFormItemdata: ","Yes&#8212;Source verify an item.","No&#8212;Mark an item as Not Verified.","pf:ItemStatus","213615.htm");
Page[40]=new Array("Sub-element of the Association element. One occurrence per form is required.","Example","&lt;Association StudyOID=&quot;Depression Study&quot;","MetaDataVersionOID=&quot;StudyVersion_ODMTEST03&quot;&gt;","&lt;KeySet StudyOID=&quot;Depression Study&quot;","SubjectKey=&quot;29530&quot;","StudyEventOID=&quot;Visit1&quot; StudyEventRepeatKey=&quot;342216927026073&quot;","FormOID=&quot;LAE1&quot; FormRepeatKey=&quot;343316719654073&quot; /&gt;","&lt;KeySet StudyOID=&quot;Depression Study&quot;","SubjectKey=&quot;29530&quot;","StudyEventOID=&quot;Visit1&quot; StudyEventRepeatKey=&quot;342216927026073&quot;","FormOID=&quot;L_ConMeds&quot; FormRepeatKey=&quot;343316927026073&quot; /&gt;","&lt;Annotation SeqNum=&quot;33663&quot; pf:DBUID=&quot;33663&quot; pf:GUID=&quot;{E34262AA-A279-4BA4-B8BA-DDABE6CC52BB}&quot;&gt;","&lt;Comment&gt;PF Association&lt;/Comment&gt;","&lt;Flag&gt;","&lt;FlagValue CodeListOID=&quot;AssociationAction&quot;&gt;Add&lt;/FlagValue&gt;","&lt;FlagType CodeListOID=&quot;FlagType&quot;&gt;Association&lt;/FlagType&gt;","&lt;/Flag&gt;","&lt;/Annotation&gt;","&lt;/Association&gt;","Supported attributes","StudyOID&#8212;Required.","SubjectKey&#8212;Required.","SubjectKeyType&#8212;Optional.","GUID (the default) or SubjectNumber.","StudyEventOID&#8212;Required.","Visit RefName.","StudyEventRepeatKey&#8212;Required for repeating visits only. ","FormOID&#8212;Required.","Form RefName.","FormRepeatKey&#8212;Required.","KeySet","188250.htm");
