Page[42]=new Array("The top-level element of an ODM document. The ODMSubmit element has several defined sub-elements, but only ClinicalData is supported for the InForm ODM format.","Example","&lt;ODMSubmit Description=&quot;Depression Study&quot; FileType=&quot;Transactional&quot;","pf:HierarchicalOIDs=&quot;Yes&quot;","xmlns=&quot;http://www.cdisc.org/ns/odm/v1.3&quot;","xmlns:pf=&quot;http://www.phaseforward.com/InFormAdapter/ODM/Extensions/2.0&quot;&gt;","&lt;ClinicalData … details omitted","&lt;ODMSubmit&gt;","Supported sub-elements","ClinicalData&#8212;Optional.","Zero or more instances.","Supported attributes","ODMVersion&#8212;Required.","ODM version number. Must be 1.3.1.","FileType&#8212;Required.","Type of the file. Must be Transactional.","FileOID&#8212;Required.","Uniquely identifies each distinct ODM bit. ","PriorFileOID&#8212;Optional.","Allows you to uniquely order ODM bits. ","The specified PriorFileOID must match the FileOID of an ODM bit that was previously processed. If it does not, the submit action fails.","CreationDateTime&#8212;Required but is not used by the Clinical Data API.","Date and time of creation.","pf:HierarchicalOIDS&#8212;Required.","Must be Yes.","Unsupported elements","AdminData","ReferenceData","Study","Unsupported attributes","Archival","AsOfDateTime","Association","Description","Granularity","Id","Originator","SourceSystem","SourceSystemVersion","pf:InFormAdapterVersion","pf:MappingVersion","ODMSubmit","188243.htm");
Page[43]=new Array("Custom InForm sub-element of the Annotation element, used to specify a reason for marking an item or form as incomplete.","To specify a reason for data incompletion, include the selection value of the incomplete reason control on the form in the body of the pf:ReasonIncomplete element, not as an attribute.","Example","&lt;pf:ReasonIncomplete CodeListOID=&quot;ReasonIncomplete&quot;&gt;NAElement&lt;/pf:ReasonIncomplete&gt;","Supported sub-elements","None","Supported attributes","CodeListOID&#8212;Required.","Must be ReasonIncomplete.","pf:ReasonIncomplete","188251.htm");
