Page[45]=new Array("Sub-element of the SubjectData element, used to specify a single visit instance for one subject.","Example","&lt;StudyEventData StudyEventOID=&quot;vstUnschVisit1&quot;","StudyEventRepeatKey=&quot;3&quot;&gt;","&lt;FormData FormOID=&quot;frmDOVRFI&quot;&gt;","…Details omitted","&lt;/FormData&gt;","&lt;/StudyEventData&gt;","Supported sub-elements","FormData&#8212;Optional.","Zero or more instances.","Supported attributes","StudyEventOID&#8212;Required.","RefName of the visit. ","StudyEventRepeatKey&#8212;Optional.","For a non-repeating visit&#8212;Do not use.","For a repeating visit&#8212;Required. ","A non-null string that uniquely identifies a given instance of the repeating visit for the subject. ","pf:StudyEventRepeatKeyOrdinal&#8212;Optional.","For a non-repeating visit&#8212;Do not use.","For a repeating visit&#8212;Required.","The 1-based ordinal index of the repeating visit for the subject.","Unsupported elements","Annotation","AuditRecord","Signature","Unsupported attributes","TransactionType","pf:Deleted","StudyEventData","188262.htm");
Page[46]=new Array("Sub-element of the ClinicalData element, used to specify data for one subject.","Example","&lt;SubjectData TransactionType=&quot;Upsert&quot;","SubjectKey=&quot;{B6E65FC3-0E73-4DA9-898A-8A11D6BCC3B5}&quot;&gt;","&lt;SiteRef LocationOID=&quot;BID&quot; /&gt;","&lt;StudyEventData StudyEventOID=&quot;vstCORE2&quot;/&gt;","&lt;/SubjectData&gt;","Supported sub-elements","SiteRef&#8212;Required.","Zero or one instance. Defines the site for the subject. ","The SiteRef element is optional in the ODM schema, but is required for InForm ODM input. To transfer a subject to a new site, use the SubjectData element and specify the new site data in the SiteRef sub-element.","StudyEventData&#8212;Optional.","Zero or more instances. Contains data for one visit instance.","pf:Candidate&#8212;Optional.","Zero or one instance. ","pf:SubjectStatus&#8212;Optional.","Zero or one instance. ","Supported attributes","SubjectKey&#8212;Required.","Unique identifier for the subject. For more information, see SubjectKey and SubjectKeyType attributes.","SubjectKeyType&#8212;Optional.","Type of key specified in the SubjectKey attribute. For more information, see SubjectKey and SubjectKeyType attributes.","Unsupported elements","Annotation","AuditRecord","InvestigatorRef","Signature","StudyEventStatus","Unsupported attributes","TransactionType","pf:GUID","SubjectData","188263.htm");
Page[47]=new Array("Used to set the status for a subject.","Example","&lt;pf:SubjectStatus State=&quot;Enrolled&quot;&gt;","&lt;/pf:SubjectStatus&gt;","Supported sub-elements","None","Supported attributes","Frozen&#8212;Optional.","Locked &#8212;Optional.","SVReady&#8212;Optional.","EnrollOverrideReason&#8212;Optional.","State&#8212;Optional.","Set to Enrolled to enroll a subject.","You cannot use the State attribute to set the subject to the following states, which are set by the InForm application, depending on data entered on a form:","ScreenFailed ","Screened ","EnrollmentFailed ","Randomized ","Complete ","DroppedOut","pf:SubjectStatus","188252.htm");
Page[48]=new Array("Used to transfer a subject from one site to another.","Example","&lt;pf:SubjectTransfer&gt;","&lt;/pf:FromSite SubjectKey=&quot;1234&quot; SubjectKeyType=&quot;SubjectGUID&quot; LocationOID=&quot;Site1&quot;&gt;","&lt;/pf:ToSite SubjectKey=&quot;1234&quot; SubjectKeyType=&quot;SubjectGUID&quot; LocationOID=&quot;Site2&quot;&gt;","Supported sub-elements","None","Supported attributes","pf:FromSite&#8212;Current site for the subject.","pf:ToSite&#8212;New site for the subject.","pf:SubjectTransfer","205833.htm");
Page[49]=new Array("Attribute of the SubjectData element, used to identify a subject. Specify one of the following:","GUID&#8212;Unique, unchanging string identifier for a subject in a study. The GUID must be a Unicode string that uses fewer than 255 bytes in the database UTF-8 character set. ","For an existing subject, use the subject GUID that exists in the InForm database.","For a new subject, specify a GUID to use for the subject. ","Subject Number&#8212;Subject number that appears in the InForm user interface to identify an enrolled subject. You can only specify a SubjectNumber for the SubjectKey attribute if you are entering data for an existing subject.","Note: Ensure that you specify the current Subject Number for the subject.","SubjectKey","188264.htm");
Page[50]=new Array("Attribute of the SubjectData element, used to specify the type of subject identification used in the SubjectKey attribute. The options are:","GUID (the default)","InForm Subject Number","SubjectKeyType","188471.htm");
Page[51]=new Array("Attribute of the ItemData element, used to specify the value for a control.","The value that you specify for the Value attribute must match the data in the ItemData element. The Value attribute is verified against the type of the ItemData, and if it is incorrect, an error occurs.","Value","188267.htm");
Page[52]=new Array("Use the Value attribute to specify the text to enter in a text control, using XML escaping if necessary. ","When you enter a value for a text control, ensure that the text conforms to the following MedML attributes specified for the control:","MAXLENGTH","DATATYPE","MINVALUE","MAXVALUE","PRECISION","CHARSET","For example, to enter text in the text box sub-controls for checkboxes 1 and 3, use the following:","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.MULTICB.SELECT1.TEXT1&quot; Value=&quot;text value 1&quot;/&gt;","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.MULTICB.SELECT3.TEXT3&quot; Value=&quot;text value 3&quot;/&gt;","Value attribute for text controls","188402.htm");
Page[53]=new Array("Use the Value attribute to specify the value for a pulldown control (drop-down list). ","Value attribute for pulldown controls","188403.htm");
Page[54]=new Array("Use the Value attribute to select a radio button in a radio control.","For example, to select the sub-control with selection value 2 in a radio control, use the following:"," &lt;ItemData ItemOID=&quot;frmA.sctB.itmC.radioD&quot;  Value=&quot;2&quot;/&gt;","To clear the selection, use the following:","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.radioD&quot;  IsNull=&quot;Yes&quot;/&gt;","Value attribute for radio controls","188404.htm");
Page[55]=new Array("Use the Value attribute to enter a date and time in a date/time control, if the following is true:","You know all of the required components in the control.","If you specify an incomplete date and time in the Value attribute, the missing date components are represented with a single dash (-) and are treated as not entered in the InForm application.","You do not need to distinguish between components that are not entered and that are entered as Unknown.","If you do not know all of the required components, or need to distinguish between components that are not entered and those that are entered as Unknown, use the pf:FormattedDateValue attribute instead of the Value attribute. For more information, see pf:FormattedDateValue.","The value that you enter for a date/time control must conform to the:","MedML attributes for the control.","ISO 8601 standard.","For example, to specify the value October 21, 2011 at 12:44, use the following:","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.dtcDateD&quot;  Value=&quot;2011-10-21T12:44&quot; /&gt;","Value attribute for date/time controls","188405.htm");
Page[56]=new Array("Use the Value attribute to select or deselect a checkbox control. ","For example, to select checkboxes 1 and 3 in an item with checkbox controls, use the following:","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.MULTICB.SELECT1&quot; Value=&quot;SELECT1&quot;/&gt;","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.MULTICB.SELECT3&quot; Value=&quot;SELECT3&quot;/&gt;","To nullify the selection of checkbox 1 set the IsNull attribute to True for checkbox 1 and use the Value attribute to select checkbox 2:","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.MULTICB.SELECT1&quot; IsNull=&quot;true&quot;/&gt;","&lt;ItemData ItemOID=&quot;frmA.sctB.itmC.MULTICB.SELECT2&quot; Value=&quot;SELECT2&quot;/&gt;","Value attribute for checkbox controls","188406.htm");
Page[57]=new Array("A group control has one or more sub-controls. You can submit data to a sub-control using the ItemData element, but you cannot submit data to the parent control.","For example, to enter data for the first and third text box sub-controls in a group control, use the following: ","&lt;ItemGroupData ItemGroupOID=&quot;frmECG.sctECG&quot;&gt;","&lt;ItemData ItemOID=&quot;frmECG.sctECG.itm1.gc1.txtSample1&quot; Value=&quot;xyz&quot;/&gt;","&lt;ItemData ItemOID=&quot;frmECG.sctECG.itm1.gc1.txtSample3&quot; Value=&quot;abc&quot;/&gt;"," &lt;/ItemGroupData&gt;","To remove the value for the first text box sub-control and add a value to the second text box sub-control, use the following: ","&lt;ItemGroupData ItemGroupOID=&quot;frmECG.sctECG&quot;&gt;","&lt;ItemData ItemOID=&quot;frmECG.sctECG.itm1.gc1.txtSample1&quot; IsNull=&quot;true&#8217;/&gt;","&lt;ItemData ItemOID=&quot;frmECG.sctECG.itm1.gc1.txtSample2&quot; Value=&quot;pqr&quot;/&gt;"," &lt;/ItemGroupData&gt;","Value attribute for group controls","188407.htm");
Page[58]=new Array("Local users can run the ODM Submit utility from the command line to submit clinical data to the InForm application in InForm ODM format. To run the ODM Submit utility from the command line, use the following parameters.","Command line options","Parameter","Variable","Description","ODMSubmit.exe","Starts the ODM Submit utility.","-trialname","trialname","Full pathname of the study into which you are importing data. ","/accountparams &quot;path_to_password_file&quot;","When specified, includes the path to a text file that contains the user name and passwords required to run the command.","If the accountparams option is not specified, the command prompts for the required user names and passwords.","The format of the parameter file is parameter=value. There is a new line for each parameter, and there are no spaces on a line.","Note: Oracle recommends that you do not use this option. The utility prompts you to enter a username and password when you run the utility from the command line. This is the most secure way to provide a password.","-verbose","Write detailed messages as it processes the input file.","-ValidateXML","Check to make sure that all required XML tags exist and the specified control paths can be found, without loading data. Optionally, use this parameter to validate an XML file before importing it.","-StoponError","Stop processing when the utility encounters an error. When errstop is not specified, the tag containing the error is skipped and the import continues with the next data tag in the file. ","-RulesDisabled","Do not run rules while submitting data. This parameter is required.","-SubmitToLockedOrFrozenForms","Submit data to a locked or frozen form. If you do not enable this option, an error occurs when you attempt to submit data to a locked or frozen form.","-File","filename","File name for the ODM Submit document.","-FileList","filename","File name for the document that contains a list of ODM Submit file names.","For example:","&lt;?xml version=&quot;1.0&quot; encoding=&quot;utf-8&quot;?&gt;","&lt;File&gt;","  &lt;File&gt;firstFileName.xml&lt;/File&gt;","  &lt;File&gt;secondFileName xml&lt;/File&gt;","&lt;/File&gt;","ODM Submit utility command line parameters","188097.htm");
